text.stringValue:
Au Prince de la vie
La mort est asservie ;
Hors de la tombe, il est monté ;
Christ est ressuscité !

Mes péchés ont disparu,
Chassés comme une fumée ;
Car pour moi Jésus mourut ;
De lui mon âme est aimée.
Sûr et fort de son appui,
Je repose en sa tendresse,

C'est toi que ma main blesse, c'est moi qui suis guéri ;
C'est moi qui me redresse, c'est toi qui es meurtri ;
Quel étrange partage de ma vie et ta mort,
Où ta mort est le gage que la vie est mon sort.

Jamais ton Dieu ne permettra
Que chancelle ton pied ;
Il garde ton sentier.
Jamais il ne sommeillera ;
Qui sur Israël veille
Ne dort ni ne sommeille.

Il est Seigneur, sa vérité règnera ;
Tout l'univers se réjouit dans son saint nom !
Il est exalté, le Roi est au-dessus des cieux.

Nous venons dans ta maison,
Et nous nous assemblons pour t'adorer ;
Nous venons dans ta maison,
Et nous nous assemblons pour t'adorer ;

Tu nous donnes ta justice
Et tu nous affranchis pour t'adorer ;
Tu nous donnes ta justice
Et tu nous affranchis pour t'adorer ;

Nous levons [les yeux] vers toi,
Et nous te contemplons pour t'adorer ;
Nous levons [les yeux] vers toi,
Et nous te contemplons pour t'adorer ;

Tu m'as aimé, Seigneur, le jour où, pour ta gloire
Jésus est apparu vivant, ressuscité.
Avec lui je revis, porté par sa victoire ;

Celui-là est comme un arbre fruitier
Près d'un courant d'eau fermement planté,
Dont ne se flétrit jamais le feuillage ;
Il a profit de ses propres ouvrages.
Il n'en est pas ainsi de ces méchants ;
Comme la paille, ils sont mus par le vent.
